n = int(input("ingrese un numero: "))

def fibonacci(n):
  if n == 0 or n == 1:
    return n
  else: 
    return fibonacci(n - 1) + fibonacci(n - 2)

def main():
  fic = fibonacci(n)
  print(fic)
if __name__ == "__main__":
  main()
